import React, { Component } from 'react'
import VoucherTypes from './VoucherTypes';

export class EventItem extends Component {
  render() {

    let eventItems = [];
		for(var i=0;i<this.props.voucherdetails.length;i++)
			eventItems.push(<VoucherTypes types={ this.props.voucherdetails[i] } />);
      //console.log(this.props.voucherdetails[i].Type);

    return (
      <div>
          <div className="card">
              <div className="card-body">
                <img className="img-thumbnail" src={this.props.thumbnail} alt={this.props.clubname} />
                  <h5 className="card-title"> {this.props.name}</h5>
                  <p>Club : {this.props.clubname}</p>
                  <p>Timings : {this.props.timings}</p>
                  <button type="button" className="btn btn-primary">Book</button>
              </div>
          </div>
      </div>
    )
  }
}

export default EventItem
